import React, { Component } from 'react';
import { Modal, Button } from 'react-bootstrap';

class DeleteConferenceNumberModal extends Component {
  state = { open: false };

  open = () => this.setState({ open: true });
  close = () => this.setState({ open: false });

  deleteConferenceNumber = () => {};

  render() {
    return (
      <Modal
        aria-labelledby="contained-modal-title-vcenter"
        centered
        show={this.state.open}
        onHide={this.close}
      >
        <Modal.Header closeButton>
          <Modal.Title>Delete Your Number</Modal.Title>
        </Modal.Header>
        <Modal.Body>
          <p>Are you sure you want to delete this number?</p>
        </Modal.Body>
        <Modal.Footer>
          <Button onClick={this.props.close} variant="secondary">
            No
          </Button>
          <Button onClick={this.deleteConferenceNumber} variant="primary">
            Yes
          </Button>
        </Modal.Footer>
      </Modal>
    );
  }
}

export default DeleteConferenceNumberModal;
